css:
@-moz-document domain("vozforums.com") {
body > div:not(#voz-living-app),
body else > div:not(#voz-living-app),
body > form.voz-living-side-menu {
    margin-left: 0px !important;
}
.voz-living-side-menu {
    margin-left: -45px;
    background-color: rgba(66, 134, 244, 0.4);
    opacity: 0.4;
    transition: all 0.2s linear;
}
.voz-living-side-menu:hover {
    visibility: visible;
    margin-left: 0px;
    transition: all 0.2s linear;
    opacity: 1.0;
}

}
